/* eslint-disable no-plusplus */
/* eslint-disable class-methods-use-this */
import {
  evaluate,
} from 'mathjs'

class OperationSign {
  constructor() {
    this.type = ['+', '-', '*', '/', '.', '%']
    this.typeNoALL = ['*', '/', '.', '%']
    this.typeWithoutPointPercent = ['+', '-', '*', '/']
    this.onlyMultiplyAndDivision = ['*', '/']
  }

}

export default OperationSign
